  console.log("data", data);
  function openWindow(url) {
    window.open(url);
  }
  return (
    <div>
      <h1>vanakam da mapla </h1>
      <Paper
        style={{
          border: "1px solid #159580",
          borderRadius: 10,
          width: 300,
          padding: 10,
          // display: "flex",
          // flexDirection: "column",
        }}
      >
        {data?.map((val, idx) => (
          <div style={{}}>
